router.afterEach(() => {
  // Remove initial loading
  const appLoading = document.getElementById('loading-bg')
    if (appLoading) {
        appLoading.style.display = "none";
    }
})

router.beforeEach((to, from, next) => {
    //Check if to path requires Auth
if(to.matched.some(record => {
    record.meta.isAuthRequired
}))
    //check if isLoggedIn is set from local storage
    if(localStorage.getItem('user_auth') == null ){
        next({
            path: '/login',
            params:{ nextUrl: to.fullPath}
        });

    }
else {
    let userToken = localStorage.getItem('user_auth');
    if(to.matched.some(record => record.meta.isSuperAdmin)){
        if(!(userToken.isAdmin))
        {
            next({
                path: ''
            });
        }
        else
        {

        }
    }
        router.push({path: '/login', query: {to: to.path}})
        // Specify the current path as the customState parameter, meaning it
        // will be returned to the application after auth
        // auth.login({ target: to.path });

    }
});

export default router
